import axios, { AxiosRequestConfig } from "axios";

import Router from "next/router";
import { SignupInputs } from "../../pages/signup";
import { catchAxiosError } from "./error";
import { post } from "./rest";

export async function signup(SignupInputs) {
  const data = new URLSearchParams(SignupInputs);
  const res = await post("/api/signup", data).catch(catchAxiosError);

  await Router.push("localhost:1323/api/signup");
}
